import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const Step2 = () => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [vehicles, setVehicles] = useState([]);
  const [filteredVehicles, setFilteredVehicles] = useState([]);
  const [filterOptions, setFilterOptions] = useState({
    minPrice: 0,
    maxPrice: 1000, // Set a default maximum price
    minSeats: 1,
    maxSeats: 10, // Set a default maximum number of seats
  });

  useEffect(() => {
    const fetchVehicles = async () => {
      try {
        const step2Data = JSON.parse(localStorage.getItem('step2Data'));
        console.log('step2Data:', step2Data); // Log step2Data to verify token availability
        const token = localStorage.getItem('token'); // Retrieve token from localStorage
        console.log('Token:', token); // Log token to verify availability

        const response = await axios.get(`https://calm-retreat-90846-cd036e8a822e.herokuapp.com/https://api.rentsyst.com/v2/booking/search`, {
          params: {
            date_from: step2Data.pickupDateTime,
            date_to: step2Data.returnDateTime,
            pickup_location: step2Data.selectedLocation,
            return_location: step2Data.selectedLocation,
          },
          headers: {
            Authorization: `Bearer ${token}` // Include token in Authorization header
          }
        });
        console.log('Response:', response.data); // Log response data

        // Set vehicles state with response data
        setVehicles(response.data.data); // Assuming vehicles are stored in response.data.data
        setFilteredVehicles(response.data.data); // Initially set filtered vehicles to all vehicles
      } catch (error) {
        console.error('Error fetching vehicles:', error);
        setError('Failed to fetch vehicles');
      } finally {
        setLoading(false);
      }
    };

    // Call fetchVehicles function
    fetchVehicles();
  }, []);

  const handleFilterChange = (event) => {
    const { name, value } = event.target;
    setFilterOptions({ ...filterOptions, [name]: value });
  };

  useEffect(() => {
    // Filter vehicles based on filterOptions
    const filtered = vehicles.filter(vehicle => {
      return (
        vehicle.price_per_day >= filterOptions.minPrice &&
        vehicle.price_per_day <= filterOptions.maxPrice &&
        vehicle.seats >= filterOptions.minSeats &&
        vehicle.seats <= filterOptions.maxSeats
      );
    });
    setFilteredVehicles(filtered);
  }, [filterOptions, vehicles]);

  const calculateTripPrice = (vehicle) => {
    const { pickupDateTime, returnDateTime } = JSON.parse(localStorage.getItem('step2Data'));
    const pickupDate = new Date(pickupDateTime);
    const returnDate = new Date(returnDateTime);
    const days = Math.ceil((returnDate - pickupDate) / (1000 * 60 * 60 * 24)); // Calculate number of days
    return days * vehicle.price_per_day;
  };

  return (
    <div className="step2">
      <h2>Available Vehicles</h2>
      <div className="filter-sidebar">
        <h3>Filter Options</h3>
        <label>Minimum Price:</label>
        <input type="number" name="minPrice" value={filterOptions.minPrice} onChange={handleFilterChange} />
        <label>Maximum Price:</label>
        <input type="number" name="maxPrice" value={filterOptions.maxPrice} onChange={handleFilterChange} />
        <label>Minimum Seats:</label>
        <input type="number" name="minSeats" value={filterOptions.minSeats} onChange={handleFilterChange} />
        <label>Maximum Seats:</label>
        <input type="number" name="maxSeats" value={filterOptions.maxSeats} onChange={handleFilterChange} />
      </div>
      <div className="vehicle-catalog">
        {loading && <p>Loading...</p>}
        {error && <p>{error}</p>}
        {!loading && !error && filteredVehicles.length === 0 && <p>No vehicles available with selected filters</p>}
        {!loading && !error && filteredVehicles.length > 0 && filteredVehicles.map(vehicle => (
          <div key={vehicle.id} className="vehicle-item">
            <h3>{vehicle.name}</h3>
            <p>Description: {vehicle.description}</p>
            <p>Features: {vehicle.features.join(', ')}</p>
            <p>Seats: {vehicle.seats}</p>
            <p>Daily Price: ${vehicle.price_per_day}</p>
            <p>Trip Price: ${calculateTripPrice(vehicle)}</p>
            {/* Render other vehicle details */}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Step2;
